import { Empty } from './Empty';
import { SpiralScan } from './SpiralScan';
import { sizelistTo2Darray_N, sizelistTo2Darray_E, sizelistTo2Darray_W, sizelistTo2Darray_S } from './drawGrid';

export class Grid {
  constructor(p, canvasW, canvasH) {
    this.p = p;

    //グリッドの大きさを指定
    this.canvasW = canvasW;
    this.canvasH = canvasH;
    //グリッドからマス目
    this.w = this.canvasW / 100;
    this.h = this.canvasH / 100;
    this.centerPos = [ Math.floor(this.w / 2), Math.floor(this.h / 2)];

    console.log("center is" + this.centerPos);
    this.grid = new Array(this.h);
    for(let y = 0; y < this.h; y++) {
      this.grid[y] = new Array(this.w).fill(0);
    }
    this.empty = new Array();
    this.setInitFill();

    this.spiralScan = new SpiralScan(this.centerPos[0], this.centerPos[1]);
  }

  setInitFill() {
    this.grid[this.centerPos[1]][this.centerPos[0]] = 1;
    //this.printGrid();
    this.deleteZero();
    this.setEmpty();
    //this.printGrid();
    //this.searchGrid();
    //this.printEmpty();
    //console.log(this.empty);
  }

  setFilled(x, y) {
    this.grid[y][x] = 1;
  }

  setEmpty() {
    for(let y = 0; y < this.h; y++) {
      for(let x = 0; x < this.w; x++) {
        if(this.grid[y][x] == 1) {
          let tmp = 0;
          //上方向の空白マス
          tmp = y - 1;
          while(0 <= tmp) {
            if(this.grid[tmp][x] == 1) {
              break;
            } else if(y - tmp == 1) {
              this.grid[tmp][x] = 3;
            } else if(this.grid[tmp][x] == 3) {
              this.grid[tmp][x] = 3;
            } else {
              this.grid[tmp][x] = 2;
            }
            tmp--;
          }

          tmp = y + 1;
          //下方向の空白マス
          while(tmp < this.h) {
            if(this.grid[tmp][x] == 1) {
              break;
            } else if(tmp - y == 1) {
              this.grid[tmp][x] = 3;
            } else if(this.grid[tmp][x] == 3) {
              this.grid[tmp][x] = 3;
            } else {
              this.grid[tmp][x] = 2;
            }
            tmp++;
          }

          tmp = x - 1;
          //左方向の空白マス
          while (0 <= tmp) {
            if(this.grid[y][tmp] == 1) {
              break;
            } else if(x - tmp == 1) {
              this.grid[y][tmp] = 3;
            } else if(this.grid[y][tmp] == 3) {
              this.grid[y][tmp] = 3;
            } else {
              this.grid[y][tmp] = 2;
            }
            tmp--;
          }

          tmp = x + 1;
          //右方向の空白マス
          while (tmp < this.w) {
            if(this.grid[y][tmp] == 1) {
              break;
            } else if(tmp - x == 1) {
              this.grid[y][tmp] = 3;
            } else if(this.grid[y][tmp] == 3) {
              this.grid[y][tmp] = 3;
            } else {
              this.grid[y][tmp] = 2;
            }
            tmp++;
          }

        }
      }
    }
  }

  printGrid() {
    let t = "";
    for(let y = 0; y < this.h; y++) {
      for(let x = 0; x < this.w; x++) {
        t += "|" + this.grid[y][x];
      }
      t += "\n";
    }
    console.log(t);
  }

  displayPoint() {
    const p = this.p;
    for(let y = 0; y < this.h; y++) {
      for(let x = 0; x < this.w; x++) {
        if (this.grid[y][x] != 1 && this.grid[y][x] != 0) {
          if(this.grid[y][x] == 2) {
            p.noStroke();
            p.fill(p.color(0, 0, 255));
            p.ellipse(this.getCoord(x), this.getCoord(y), 10, 10);
          } else if(this.grid[y][x] == 3) {
            p.noStroke();
            p.fill(p.color(255, 0, 0));
            p.ellipse(this.getCoord(x), this.getCoord(y), 10, 10);
          }
        }
      }
    }
  }

  searchGrid() {
    this.empty.splice(0);
    for(let y = 0; y < this.h; y++) {
      for(let x = 0; x < this.w; x++) {
        if(this.grid[y][x] == 3) {
          const e = new Empty(y, x);

          let tmp = 0;
          let s = "";

          s = "col";
          //上方向
          tmp = y - 1;
          while(0 <= tmp) {
            if(this.grid[tmp][x] == 1) {
              break;
            } else if(this.grid[tmp][x] == 2) {
              e.setPos(tmp, x, s, false);
            } else if(this.grid[tmp][x] == 3) {
              e.setPos(tmp, x, s, true);
            }
            tmp--;
          }
          //下方向
          tmp = y + 1;
          while(tmp < this.h) {
            if(this.grid[tmp][x] == 1) {
              break;
            } else if(this.grid[tmp][x] == 2) {
              e.setPos(tmp, x, s, false);
            } else if(this.grid[tmp][x] == 3) {
              e.setPos(tmp, x, s, true);
            }
            tmp++;
          }

          s = "row";
          //左方向
          tmp = x - 1;
          while (0 <= tmp) {
            if(this.grid[y][tmp] == 1) {
              break;
            } else if(this.grid[y][tmp] == 2) {
              e.setPos(y, tmp, s, false);
            } else if(this.grid[y][tmp] == 3) {
              e.setPos(y, tmp, s, true);
            }
            tmp--;
          }
          //右方向の空白
          tmp = x + 1;
