  makeAarray(index, reservedPos, text, sizelist) {
    let dir = '';
    switch(index) {
      case 0:
        dir = 'N';
        break;
      case 1:
        dir = 'E';
        break;
      case 2:
        dir = 'W';
        break;
      case 3:
        dir = 'S';
        break;
    }
    const reserved = this.sortDataBy(dir, reservedPos, sizelist, text);
    return reserved;
  }

  sortDataBy(dir, array, sizelist, text) {
    //console.log("sortDataBy です");
    //console.log(array);
    //文字方向によってソート順を変える
    if(dir === 'N') {
      array.sort(function(a, b) {
        return a[1] - b[1];
      });
    } else if(dir === 'S') {
      array.sort(function(a, b) {
        return b[1] - a[1];
      });
    } else if(dir === 'E') {
      array.sort(function(a, b) {
        return a[0] - b[0];
      });
    } else if(dir === 'W') {
      array.sort(function(a, b) {
        return b[0] - a[0];
      });
    }

    const sizedPos = new Array();
    let increment = 0;
    for(const size of sizelist) {
      const leng = increment + size * size;
      sizedPos.push(array.slice(increment, leng));
      increment = leng;
    }
    const res = new Array();
    //連想配列をつくる
    for(let i = 0; i < sizelist.length; i++) {
      res.push({text: text.split('')[i], dir: dir, size: sizelist[i], pos: sizedPos[i]});
    }

    return res;
  }

  isEqual(num1, num2) {
    if(num2 == 0) return -1;
    if(num1 == 3 || num1 == 2) num1 = 5;
