    return 0;
  }

  isEqualArray(array1, array2) {
    let i = array1.length;
    if(i != array2.length) return false;
    while(i--) {
      const a1 = array1[i];
      if(array2[i] == 0) continue;
      if(a1 == 3 || a1 == 2) array1[i] = 5;
      if(array1[i] !== array2[i]) return false;
    }
    return true;
  }

